informacaoComplementar:
No decorrer de suas atividades, a AGERO estruturou um modelo de gestão que valoriza a participação e a melhoria contínua do desempenho da agência, adotando metodologias e práticas focadas no planejamento, divulgação de resultados e avaliação do desempenho de seus servidores.

Contudo, essas metodologias e práticas necessitam de atualização para incorporar novos conceitos que promovam maior dinamismo e eficiência, considerando aspectos como regulação, fiscalização, fluxos documentais, estágio das áreas de atuação, planejamento, alinhamento estratégico e agenda regulatória.

Nos últimos anos, a AGERO, ao perseguir seu objetivo estratégico de ampliar sua atuação regulatória, enfrentou novos desafios que aumentaram significativamente suas responsabilidades. Esse cenário exige o amadurecimento de seu modelo de gestão e o fortalecimento de seus processos organizacionais, assegurando a utilização adequada dos recursos, segurança jurídica e estabilidade regulatória.

O escopo de atuação e as atribuições específicas da AGERO delineiam problemas típicos das agências reguladoras na administração pública contemporânea, demandando um modelo de gestão que, além da tecnicidade, incorpore transparência, prestação de contas e governança, equilibrando os interesses dos poderes concedentes, operadores de serviços públicos e usuários finais.

Diante disso, a contratação de consultoria visa promover ações de modernização e fortalecimento organizacional na AGERO, atendendo às demandas de seus públicos internos e externos, por meio de:

a) diagnóstico organizacional e entrevistas;

b) regulação e fiscalização;

c)capacitação e workshops dos servidores;

d)construção e estabelecimento de metas;

e)elaboração e entrega de planejamento estratégico da AGERO; e

f)apresentação do cronograma de acompanhamento.

