informacaoComplementar:
A necessidade de contratação se justifica pelos seguintes motivos: 
? Base sólida para a implantação do SGQ: As normas ABNT e ISO estabelecem requisitos e diretrizes internacionalmente reconhecidas para a implementação de sistemas de gestão da qualidade. Ao ter acesso a essas normas, a Defensoria Pública contará com um referencial técnico sólido para estruturar seus processos, garantindo a conformidade com os padrões exigidos pela certificação ISO 9001;
? Melhoria contínua dos processos: As normas técnicas proporcionam ferramentas e metodologias para a identificação e análise de processos, permitindo a identificação de oportunidades de melhoria e a implementação de ações corretivas e preventivas. Dessa forma, a Defensoria Pública poderá otimizar seus fluxos de trabalho, reduzir custos e aumentar a eficiência de seus serviços; 
? Garantia da qualidade do atendimento à população: A implantação do SGQ, embasada nas normas técnicas, contribuirá para a padronização dos procedimentos e a melhoria da qualidade do atendimento prestado à população carente. Ao adotar um sistema de gestão da qualidade, a Defensoria Pública demonstra seu compromisso em oferecer serviços de excelência, atendendo às necessidades e expectativas dos cidadãos;
? Fortalecimento da imagem institucional: A certificação ISO 9001 é um importante diferencial competitivo, que agrega valor à imagem institucional da Defensoria Pública. Ao obter essa certificação, a instituição demonstra sua capacidade de gestão, transparência e comprometimento com a qualidade, fortalecendo sua credibilidade perante a sociedade e os parceiros.
